import { faker } from 'https://cdn.skypack.dev/@faker-js/faker/locale/es_MX';
import { fetchCreateShipment } from '../api/shipments.js';

const btn = document.getElementById("btn-crear");
const num = document.getElementById("numero-envios").value;
btn.addEventListener('click', () =>{
    console.log("Numero de envios a crear:", num)
    createShipmentFakeData(num);
})


async function createShipmentFakeData(num){
    if(!num || isNaN(num)) return;
    if(num < 0 || num > 1000) return;
    
    const body = document.getElementById("body");

    for(let i=0; i<num; i++){
        let localidad_remitente = await getLocationDataOfXalapa();
        let localidad_destinatario = await getLocationData();

        let shipmentData = {
            sucursal: "00001",
            colaborador: "111111",
            peso: parseFloat(faker.number.float({ min: 0.5, max: 6, precision: 0.01 }).toFixed(2)), // Peso en kg
            largo: parseFloat(faker.number.float({ min: 10, max: 80, precision: 0.01 }).toFixed(2)), // Largo en cm
            ancho: parseFloat(faker.number.float({ min: 10, max: 80, precision: 0.01 }).toFixed(2)), // Ancho en cm
            alto: parseFloat(faker.number.float({ min: 10, max: 80, precision: 0.01 }).toFixed(2)),  // Alto en cm
            contenido: faker.commerce.productName(), // Contenido del paquete
            servicio: faker.helpers.arrayElement(['Express','DÃ­a_siguiente','2-5_Dias','Terrestre']), // Tipo de servicio
            seguro: faker.datatype.boolean(), // Seguro (true o false)
            metodo_de_pago: "Efectivo",
            pago_con: parseFloat(faker.number.float({ min: 10000, max: 50000, precision: 0.01}).toFixed(2)), // Pago con billetes grandes
            
            // Datos del remitente
            nombre_remitente: faker.person.fullName(),
            correo_remitente: faker.internet.email(),
            telefono_remitente: "" + faker.number.int({min: 2200000000, max: 9600000000}),
            calle_remitente: faker.location.street(),
            numeroExt_remitente: faker.location.buildingNumber(),

            colonia_remitente: localidad_remitente["nombre"],
            cp_remitente: localidad_remitente["cp"],
            ciudad_remitente: localidad_remitente["municipio"],
            estado_remitente: localidad_remitente["c_estado"],

            // Datos del destinatario
            nombre_destinatario: faker.person.fullName(),
            correo_destinatario: faker.internet.email(),
            telefono_destinatario: "" + faker.number.int({min: 2281000000, max: 2283000000}),
            calle_destinatario: faker.location.street(),
            numeroExt_destinatario: faker.location.buildingNumber(),
            referencias_destinatario: faker.lorem.sentence(),

            colonia_destinatario: localidad_destinatario["nombre"],
            cp_destinatario: localidad_destinatario["cp"],
            ciudad_destinatario: localidad_destinatario["municipio"],
            estado_destinatario: localidad_destinatario["c_estado"],
        };
        
        let shipment = null;

        if(shipmentData){
            try{
                shipment = await fetchCreateShipment(shipmentData);
            }catch(e){
                const nuevoElemento = document.createElement('p');
                nuevoElemento.textContent = `Error del servidor, [${i}]`;
                body.appendChild(nuevoElemento);
            }
        }

        if(shipment && Object.keys(shipment).length > 0 && shipment["guia"]){
            const row = document.createElement('tr');

            const folio = document.createElement('td');
            const guia = document.createElement('td');
            const destinatario = document.createElement('td');

            folio.textContent = shipment["folio"];
            guia.textContent = shipment["guia"];
            destinatario.textContent = shipment["nombre_destinatario"];

            row.appendChild(folio);
            row.appendChild(guia);
            row.appendChild(destinatario);
            
            body.appendChild(row);
        }else{
            const nuevoElemento = document.createElement('p');
            nuevoElemento.textContent = `Error al crear el envio, [${i}]`;
            body.appendChild(nuevoElemento);
        }
    }
}


async function getLocationData(){
    let location = {};
    let success = false;
    let cont = 0;

    while(success === false && cont < 1){
        const tempZipCode = faker.helpers.arrayElement(codigos_postales);
        const url = `http://localhost/backend/utils/location-data/${tempZipCode}`;

        try{
            const response = await fetch(url);
            location = await response.json();
            if(location["nombre"]) success = true;
        }catch(error){}
        cont++;

        if(!success){
            setTimeout(function() {
                console.log("En espera para no gastar recursos...");
              }, 1000); 
        }

    }
    return location;
}


